def part2(data: str):
    import string
    diff = 32
    min_len = float('inf')
    for exclude in string.ascii_lowercase:
        start = 0
        while data[start].lower() == exclude:
            start += 1
        s = [data[start]]
        for l in data[start+1:]:
            if l.lower() == exclude:
                continue
            if not s or abs(ord(l) - ord(s[-1])) != diff:
                s.append(l)
            else:
                del s[-1]

        min_len = min(min_len, len(s))
    print(min_len)


def part1(data: str):
    diff = 32
    s = [data[0]]
    for l in data[1:]:
        if not s or abs(ord(l) - ord(s[-1])) != diff:
            s.append(l)
        else:
            del s[-1]
    print(len(s))


